import React, {Component, useState, useEffect} from "react";
import ReactDOM from 'react-dom';
import { Axios } from "axios";
import './index.css';

import{
BrowserRouter as Router,
Routes,
Route,
Switch,
Redirect
} from "react-router-dom"

import OfertAdd from "./Ofert/OfertAdd"
import Categories from "./Category/Categories"
import Mainbar from "./Mainbar";
import Hello from "./Hello";
import Register from "./Register";
import Login from "./Login";
import Error from "./Error";
import CategoryOption from "./Category/CategoryOption";
import NameForm from "./NameForm";
import OfertSelect from "./Ofert/OfertSelect";



function App(){

    return(

      <Router>
        <main>

        </main>
        <Routes>
          <Route path='/' element={<div><Mainbar/><Hello login="studencie" /> <OfertSelect /></div>} />
          <Route path={'/Dom'} element={<CategoryOption /> } />
          <Route path={'/login'} element={<div><Mainbar/><Login /></div> } />
          <Route path={'/register'} element={<div><Mainbar/><Register /></div> } />
          <Route path={'/Ofert'} element={<div><Mainbar/><OfertAdd /><OfertSelect /></div> } />
          <Route path={'/Category'} element={<div><Mainbar/><Categories /><CategoryOption /></div> } />
          <Route path='*' element={<Error /> } />
        </Routes>
        </Router>);


  }




ReactDOM.render(<App/>,document.getElementById('root'));
